    <h1>foodpanda</h1>
    <HeaderCartBtn></HeaderCartBtn>
</header>
<div className={classes['main-image']}>
    <img  alt="food"
    src="https://github.com/academind/react-complete-guide-code/blob/11-practice-food-order-app/extra-files/meals.jpg?raw=true"/>
</div>

</>
}
export default Header;
